import React from 'react';

const Header = () => {
  return (
    <header>
      <div>
        {/* Use an absolute path to reference the image in the public folder */}
        <img src="%PUBLIC_URL%/logo.png" alt="Header" />
      </div>
    </header>
  );
};

export default Header;
